import React from 'react';

export class Home extends Component {
    render() {
        return (
            <View>
                <ScrollView>
                    <View style={styles.container}>
                        <Image
                            style={{
                                width: 140,
                                height: 140,
                                marginTop: 26
                            }}
                            resizeMode={'cover'}
                            source={require('./assets/pic_icon_otp.png')}
                        />
                        <Text
                            style={{
                                fontSize: 18,
                                marginBottom: 8,
                                marginTop: 56,
                                fontWeight: 'bold'
                            }}>Verify Your Number</Text>
                        <Text
                            style={{
                                marginStart: 8,
                                marginBottom: 24,
                                color: '#4D4D4D',
                                marginTop: 13,
                            }}
                        >OTP has been sent to your mobile number. Please Verify</Text>
                        <TextInput
                            style={{
                                height: 40,
                                width: "94%",
                                padding: 10,
                                borderRadius: 4,
                                textAlign: 'center',
                                borderColor: 'gray',
                                backgroundColor: '#FFFFFF',
                                borderWidth: 1,
                            }}
                            placeholder="Enter OTP"
                            defaultValue=""
                        />
                        <Text
                            style={{
                                color: "#00C8E4",
                                marginTop: 10,
                            }}>
                            Resend in 60 Seconds
                      </Text>
                        <View style={[{
                            width: "94%",
                            marginStart: 10,
                            marginEnd: 10,
                            marginTop: 24,
                            marginBottom: 16,
                            backgroundColor: "#00C8E4",
                            borderRadius: 4,
                        }]}>
                            <Button
                                title="Verify"
                                color="#00C8E4"
                                onPress={() =>
                                    navigation.navigate('ForgotPassword', { name: 'Jane' })
                                }
                            />
                        </View>

                        <StatusBar style="auto" />
                    </View>

                </ScrollView>
            </View>
        );
    }
}
